import Vue from 'vue';
import Router from 'vue-router';

import Login from '../components/Login'
import Register from '../components/Register'
import Dashboard from '../components/Dashboard'
import dashboards from '../components/dashboards'
import dashboards1 from '../components/dashboards1'
import HelloWorld from '../components/HelloWorld'

import About from '../components/About'

import Contact from '../components/Contact'
//import Register from '../components/Register'
//import Login from '../components/Login'
//import Dashboard from '../components/Dashboard'

import Activity from '../components/Activity'
import Professional from '../components/Professional'
import Academic from '../components/Academic'

import Checkout from '../components/Checkout'
//import Search from '../components/Search'

import Signin from '../components/Signin'
import Signup from '../components/Signup'

//Home
import Home from '../components/Home'
//import Home from '../components/layout/Home'
//import Contact from '../components/Contact'
//import Header from '../components/layout/home/header'
//import Footer from '../components/layout/home/footer'

//Admin
import Admin from '../components/layout/Admin'

//items
import itemCreate from '../components/items/Create.vue';
import itemEdit from '../components/items/Edit.vue';
import itemIndex from '../components/items/Index.vue';

//categories
import categoryCreate from '../components/categories/Create.vue';
import categoryEdit from '../components/categories/Edit.vue';
import categoryIndex from '../components/categories/Index.vue';

//companies
import companyCreate from '../components/companies/Create.vue';
import companyEdit from '../components/companies/Edit.vue';
import companyIndex from '../components/companies/Index.vue';

//locations
import locationCreate from '../components/locations/Create.vue';
import locationEdit from '../components/locations/Edit.vue';
import locationIndex from '../components/locations/Index.vue';

//blogs
import blogCreate from '../components/blogs/Create.vue';
import blogEdit from '../components/blogs/Edit.vue';
import blogIndex from '../components/blogs/Index.vue';

//countries
import countryCreate from '../components/countries/Create.vue';
import countryEdit from '../components/countries/Edit.vue';
import countryIndex from '../components/countries/Index.vue';

//profile
import profile from '../components/profile/index.vue';

Vue.use(Router)

const router = new Router({
    mode: 'history',
    base: process.env.BASE_URL,
    routes: [
    {
        path: '/hello',
        name: 'HelloWorld',
        component: HelloWorld
    },
    {
        path: "/",
        name: 'Home',
        component: Home,
    },
    {
        path: "/admin",
        name: 'Admin',
        component: Admin,
    },
   {
        path: "/about",
        name: 'About',
        component: About,
    },
    {
        path: "/contact",
        name: 'Contact',
        component: Contact,
    },
    {
        path: "/register",
        name: 'Register',
        component: Register,
    },
    {
        path: "/login",
        name: 'Login',
        component: Login,
    },
    {
        path: "/dashboard",
        name: 'Dashboard',
        component: Dashboard,
    },
    {
        path: "/dashboards",
        name: 'dashboards',
        component: dashboards,
    },
    {
        path: "/dashboards1",
        name: 'dashboards1',
        component: dashboards1,
    },
    {
        path: "/activity",
        name: 'Activity',
        component: Activity,
    },
    {
        path: "/professional",
        name: 'Professional',
        component: Professional,
    },
    {
        path: "/academic",
        name: 'Academic',
        component: Academic,
    },
    {
        path: "/checkout",
        name: 'Checkout',
        component: Checkout,
    },
    //{
    //    path: "/search",
    //    name: 'Search',
    //    component: Search,
   // },
    {
        path: "/signin",
        name: 'Signin',
        component: Signin,
    },
    {
        path: "/signup",
        name: 'Signup',
        component: Signup,
    },
    {
        path: "/admin",
        name: 'Admin',
        component: Admin,
    },
    {
        name: 'itemCreate',
        path: '/items/create',
        component: itemCreate
      },
      {
        name: 'itemEdit',
        path: '/items/edit/:id',
        component: itemEdit
      },
      {
        name: 'itemIndex',
        path: '/items/index',
        component: itemIndex
      },
      {
        name: 'categoryCreate',
        path: '/categories/create',
        component: categoryCreate
      },
      {
        name: 'categoryEdit',
        path: '/categories/edit/:id',
        component: categoryEdit
      },
      {
        name: 'categoryIndex',
        path: '/categories/index',
        component: categoryIndex
      },
      {
        name: 'companyCreate',
        path: '/companies/create',
        component: companyCreate
      },
      {
        name: 'companyEdit',
        path: '/companies/edit/:id',
        component: companyEdit
      },
      {
        name: 'companyIndex',
        path: '/companies/index',
        component: companyIndex
      },
      {
        name: 'locationCreate',
        path: '/locations/create',
        component: locationCreate
      },
      {
        name: 'locationEdit',
        path: '/locations/edit/:id',
        component: locationEdit
      },
      {
        name: 'locationIndex',
        path: '/locations/index',
        component: locationIndex
      },
      {
        name: 'blogCreate',
        path: '/blogs/create',
        component: blogCreate
      },
      {
        name: 'blogEdit',
        path: '/blogs/edit/:id',
        component: blogEdit
      },
      {
        name: 'blogIndex',
        path: '/blogs/index',
        component: blogIndex
      },
      {
        name: 'countryCreate',
        path: '/countries/create',
        component: countryCreate
      },
      {
        name: 'countryEdit',
        path: '/countries/edit/:id',
        component: countryEdit
      },
      {
        name: 'countryIndex',
        path: '/countries/index',
        component: countryIndex
      },
      {
        name: 'profile',
        path: '/profile/index',
        component: profile
      },
]
});

export default router
